            p.Surname = surname;
            p.Email = email;
            p.Phone = phone;

            Address a = new Address();
            a.Street = address;
            a.City = city;
            a.State = state;
            p.Address = a;

            p.Colours = colours;
            p.Companies = companies;

            return p;
        }

